import React from "react";
import { Link } from "react-router-dom";

const Home = () =>{
    return(
        <React.Fragment>
            <Link to ="/login">Login</Link>
            <Link to ="/adminRegister">Register</Link>
        </React.Fragment>
    )
}
export default Home;
